import React from 'react';
import '../App.css';

function LeftNav() {
  return (
    <div className="left-nav">
<ul>
    <li>Dark Roast</li>
    <li>Medium Roast</li>
    <li>Light Roast</li>
    <li>Premium Roast</li>
</ul>

    </div>
  );
}

export default LeftNav;
